import { Box, CircularProgress, Grid, Toolbar } from '@mui/material';
import { useQuery } from 'react-query';
import { Loading } from '../../Loading/Loading';
import { EXPLORE_SIDE_PANEL_WIDTH } from '../consts';
import { SearchResultsGridItem } from './SearchResultsGridItem';

interface Recipe {
  id: number;
  title: string;
  image: string;
  imageType: string;
}

export const ExplorerSearchResults = () => {
  const {
    data: { results: recipes } = [],
    isFetching,
    ...rest
  } = useQuery(['test'], async () => {
    const res = await fetch(
      // 'https://api.spoonacular.com/recipes/complexSearch?apiKey=3a919f863b6f473e93b2473cdd0b6e3d&query=pasta&maxFat=25&number=2',
      'https://api.spoonacular.com/recipes/complexSearch?apiKey=3a919f863b6f473e93b2473cdd0b6e3d',
    );
    return res.json();
  });

  console.log('asd', recipes.results);

  return (
    <Box
      component='main'
      sx={{ flexGrow: 1, p: 3, width: { sm: `calc(100% - ${EXPLORE_SIDE_PANEL_WIDTH}px)` } }}
    >
      <Toolbar />
      {isFetching || !recipes ? (
        <Loading />
      ) : (
        <Grid container spacing={3}>
          {recipes.map((recipe: Recipe) => (
            <SearchResultsGridItem key={recipe.id} />
          ))}
        </Grid>
      )}
    </Box>
  );
};
